import "./modal.css";
import { useState } from 'react';


export default function Test(){
    const [modal, setModal] = useState(false);

    const toggleModal = () => {
      setModal(!modal);
    };
    return (
      <>
            <button onClick={toggleModal} className="btn-modal">
                Open
            </button>
      </>
    );

}
